import React from 'react';
import './navbar.css';
const Navbar = () => {
	return(
		<div>
		<ul className='tl'>
		<li><h3> Home </h3></li>
		<li><h3> Bio </h3></li>
		<li><h3> Contact </h3></li>
		</ul>
		</div>
		);

}

export default Navbar;
